var navigator = create_navigator([-163, 72, -118], [-454, 63, -190])
    .animation(1)
    .dialog("ААА. Приглашение");

function init(event) {
    navigator.init(event);
}

function dialogClose(event) {
    navigator.dialogClose(event);
}

function tick(event) {
    navigator.tick(event);
}

function init_(event) {
    event.npc.getAi().setMovingType(0)
    event.npc.getAi().setAnimation(1)
    event.npc.setHome(-163, 72, -118)
}

function dialogClose_(event) {
    if (event.dialog.getName() === "ААА. Приглашение") {
        event.npc.getAi().setMovingType(2)
    }
}

function tick_(event) {
    if (event.npc.getAi().getMovingType() == 2 && event.npc.getPos().distanceTo(event.API.getIPos(-454, 63, -190)) <= 3) {
        event.npc.getAi().setMovingType(0)
        event.npc.getAi().setAnimation(0)
        event.npc.setHome(-454, 63, -190)
    }
}
